import Button from "./components/Button";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header
        style={{
          color: "black",
          textAlign: "center",
          fontSize: "120px",
          backgroundColor: "pink",
        }}
      >
        Quote Generator
        <hr></hr>
      </header>
      <Quotes
        heading="What is your favorite game in life"
        author="Murial Anindo"
      />
      <Button />
    </div>
  );
}

export default App;
